import React from "react";
import "./css/style.css";
const Weather = () => {
  return (
    <>
      <div className="box">
        <div className="box-info">
          <input type="search" placeholder="search.." className="inp"></input>
          <button type="text" placeholder="search" className="btn">
            Search
          </button>
        </div>
      </div>
      <article className="arc">
          <div className="inside-arc">
              <i className={"wi wi-day-sunny"}></i>
          </div>
          <div className="Temp">28.57
          <div className="status">Clouds
          <p className="para">Tokyo,jp</p>
          </div>
          <div className="date">{new Date().toLocaleString()}
          </div>
          </div>
      </article>
    </>
  );
};
export default Weather;
